  return (
    <div className="app">
      <div className="box">
        <h3> Enter Room Details </h3>
        <TextField id="outlined-basic" label="Enter Your Name..." variant="outlined" type="text" />
        <TextField id="outlined-basic" label="Enter Room ID..." variant="outlined" type="text" />
        <Button varient="contained" type="submit">
          Join
        </Button>
      </div>
    </div>
  );
}

export default App;
